import React from 'react';
import "./Home.css";
import { Card, Button } from 'react-bootstrap';
import Background from '../../laptop2.jpg';

var sectionStyle = {
    width: "99vw",
    height: "74.313em",
    backgroundImage: `url(${Background})`
  };

const Home = () => (
    <div className="Home">
        <section style={ sectionStyle }>
            <div className="header-text">
                <h2 id="header-top-text">Automation and IT services for businesses of all shapes and sizes</h2>
                <h1 id="header-bottom-text">12345</h1>
                <Button id="header-button">LET'S GET STARTED</Button>
            </div>
        </section>
        <div className="header">

        </div>
        <div className="lander">
            <Card id="newsletter-card" className="mx-auto">
                <Card.Header>Featured</Card.Header>
                <Card.Body>
                    <Card.Title>Stay in the know by joining our newsletter!</Card.Title>
                    <Card.Text>
                    With supporting text below as a natural lead-in to additional content.
                    </Card.Text>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
            </Card>
        </div>
    </div>
);

export default Home;
